import * as React from 'react';
import { Link} from 'react-router-dom';
import './Card.css';

export interface ICardProps {
  link?: String;
  subtitle: String;
  color?: any;
  linearGradient? : String[];
}

export default class Card extends React.Component<ICardProps> {

  public render() {

    const linearGradient: any = this.props.linearGradient;
    const color = this.props.color?? 'primary';
    const subtitle = this.props.subtitle?? 'Subtitle';
    const link = this.props.link ?? '/'; 

    console.log();

    return (
        <div className="card col p-0 m-3">
          <div className="card-body">
            <div className='row'>
              <div className='col-8'>
                <div className="statusNumber text-start">4</div>
                <div className="statusDesc text-muted text-start">{subtitle}</div>
              </div>   
              <span className="col material-symbols-outlined">
                group
              </span>
            </div>
          </div>
          <Link to={`${link}`}>
            <div 
              className="card-footer text-white" 
              style={{
                      backgroundImage: `linear-gradient(red, blue)`,
                      color: color
                    }}>
              Ver todos
            </div>
          </Link>
        </div>
    );
  }
}
